/** @format */

import React from 'react';
import { SupplierList } from '../TextInfo';
import '../App.css';

const SupBlock = ( i ) => {
    i = i.i;
    const item = SupplierList[i];
    const background = {
        backgroundImage: `url(../images/suppliersLogo/${item.img[0]})`,
    };
    return (
        Hello
    );
};

export default SupBlock;
